func TestAggregateByPackageReport(t *testing.T) {
	assertions := assert.New(t)
	tmplData := &templateData{
		TestResultGroupIndicatorWidth:  "20px",
		TestResultGroupIndicatorHeight: "16px",
		ReportTitle:                    "test-title",
		numOfTestsPerGroup:             2,
		GroupByPackage:                 true,
		OutputFilename:                 "test-output-report.html",
	}
	flags := &cmdFlags{}
	data := reportData
	stdinScanner := bufio.NewScanner(strings.NewReader(data))
	cmd := &cobra.Command{}
	allPackageNames, allTests, _ := readTestDataFromStdIn(stdinScanner, flags, cmd)
	testFileDetailByPackage, _ := getPackageDetails(allPackageNames)

	elapsedTestTime := 3 * time.Second
	writer := bufio.NewWriter(&bytes.Buffer{})
	err := generateReport(tmplData, allTests, testFileDetailByPackage, elapsedTestTime, writer)
	assertions.Nil(err)
	assertions.Equal(18, tmplData.NumOfTestPassed)
	assertions.Equal(0, tmplData.NumOfTestFailed)
	assertions.Equal(1, tmplData.NumOfTestSkipped)
	assertions.Equal(19, tmplData.NumOfTests)
	totalTests := 0
	for _, result := range tmplData.TestResults {
		totalTests += len(result.TestResults)
	}
	assertions.Equal(tmplData.NumOfTests, totalTests)

	for _, result := range tmplData.TestResults {
		for _, tr := range result.TestResults {
			assertions.Equal(tr.Package, result.PackageName)
		}
	}
}
